import React, { Component } from 'react';
import { Link } from 'react-router';
import * as jwt_decode from 'jwt-decode';

export default class Head extends Component {
	constructor(props) {
		super(props);
		this.state = {
			user: {}
		};
		var user = localStorage.token ? jwt_decode(localStorage.token) : {};

		this.setState = {
			user: user
		};
		console.log(this.props)
		this.logout = this.logout.bind(this);

	}

	logout() {
		localStorage.clear("token");
		console.log(this)
		this.props.history.push("/");
		return
	}
	render() {
		return (
			<div id="head">
				<div id="nav">
					<ul>
						<li><Link exact to="">О сайте</Link></li>
						<li><Link exact to="/learn">Обучение</Link></li>
						<li><Link exact to={{
				pathname: "/test",
				state: this.state
			}}>Тестирование</Link></li>
						<li><Link exact to="/login">Вход</Link></li>
						<li><Link exact to="/logout" onClick={this.logout}>Выход</Link></li>
					</ul>
				</div>
			</div>
			);
	}
}
